nodes.title:
{
  "name": "長さ",
  "description": "mm単位の数値、変数要素名,式文字列、例) \"100.0\" , \"L1\", \"L1 / 2.0\""
}

{
  "name": "角度",
  "description": "度(°)単位の数値、変数要素名,式文字列、例) \"30.0\" , \"Angle1\" , \"Angle1 * 0.2\""
}

{
  "name": "点",
  "description": "\",\" 区切りでX,Y,Zを長さで指定（3D時）または変数等を含む。例) \"100.0,50,0,0.0\" , \"FRM1,0.0,1000.0\""
}

{
  "name": "方向",
  "description": "各軸方向は\"+X\",\"-X\",\"+Y\",\"-Y\",\"+Z\",\"-Z\" のいずれか。別に数値をカンマ区切りで指定する場合あり"
}

{
  "name": "平面",
  "description": "文字列で指定。最初のカラムは必ず\"PL\"。オフセットや基準平面の指定などを含む。例）\"PL,Z\"、\"PL,O,500.0,X\""
}

{
  "name": "格納単位",
  "description": "長さの単位：mm, cm, m, in, ft, pt のいずれか。角度の単位：deg, rad のいずれか。値は文字列として扱う"
}

{
  "name": "要素グループ",
  "description": "EVO.SHIPの要素グループ名。階層は\"/\"で区切る"
}

{
  "name": "注記スタイル",
  "description": "EVO.SHIPに設定している注記スタイルの名称"
}

{
  "name": "材料",
  "description": "EVO.SHIPに設定している材料の名称"
}

{
  "name": "スイープ方向",
  "description": "\"N\"順方向, \"R\"反対方向, \"B\"両方向, \"2\"２方向, \"T\"貫通"
}

{
  "name": "厚み付けタイプ",
  "description": "\"+\"内側, \"-\"外側, \"B\"両方向, \"2\"２方向, \"\" 空文字は厚み付けなし"
}

{
  "name": "オペレーションタイプ (ボディ)",
  "description": "\"+\"和, \"-\"削除, \"*\"積"
}

{
  "name": "関連設定",
  "description": "ボディ関連は\"B\"、それ以外はフィーチャー関連（空白含む）"
}

{
  "name": "形状タイプ",
  "description": "部材既定寸法設定ファイルで用いる形状番号。例: 1007, 1003, 1101, 1120, 1503 など"
}

{
  "name": "形状パラメータ",
  "description": "各形状タイプの寸法値を文字列配列で設定。例) [\"150.\",\"90.\",\"9.0\",\"12.\",\"6.\"]"
}

{
  "name": "要素",
  "description": "EVO.SHIPの各要素を指定。ID指定（\"ID@<ID>\"）または要素名指定（グループ経由含む）"
}

{
  "name": "フェイス指定",
  "description": "要素IDと固定文字\"F\"、その後のフェイス座標値をカンマ区切りで列挙。複数指定可"
}

